        <section id="formSection">
        <div id="formContainer">
            <div id="formImgDiv"></div>
            <div id="formContent">
            <div id="formWrap">

                <h3>Get Started!</h3>
                <div>
                <div id="form">
                    <input name="name" className="textField" placeholder="Your Name *"/>
