                    <input name="number" className="textField" placeholder="Phone *"/>
                    <input name="address" className="textField" placeholder="Address"/>
                    <textarea name="message" id="textArea" placeholder="Message *"/>
                    <div id="btnFormContainer">
                        <div id="buttonForm" onClick={() => submitForm()}>
                            send message
                        </div>
                    </div>
                </div>
                </div>
                </div>
            </div>

        </div>
        </section>
    );
}
